"use strict";(self.webpackChunkrandelltuazon=self.webpackChunkrandelltuazon||[]).push([[9202],{6202:e=>{e.exports=JSON.parse('{"blogPosts":[{"id":"break-my-own-heart","metadata":{"permalink":"/blogs/quotes/break-my-own-heart","source":"@site/blogs/quotes/2023-11-29-break-my-own-heart.md","title":"","description":"For you, I\'ll break my own heart if I have to.","date":"2023-11-29T00:00:00.000Z","formattedDate":"November 29, 2023","tags":[{"label":"quotes","permalink":"/blogs/quotes/tags/quotes"}],"readingTime":0.125,"hasTruncateMarker":false,"authors":[{"name":"Randell Tuazon","title":"Dev/Poet/Writer","url":"https://www.instagram.com/randelltuazon.poetry","imageURL":"https://2.gravatar.com/avatar/8d15e5eb3cd8eb14ada9c614f65cb4c53693993a98a784a05f0b2ba31e6bee46?size=128","key":"randelltuazon"}],"frontMatter":{"slug":"break-my-own-heart","title":"","authors":["randelltuazon"],"keywords":["randell tuazon","quotes"],"tags":["quotes"]},"unlisted":false,"nextItem":{"title":"","permalink":"/blogs/quotes/whats-not-to-love-partial"}},"content":"<br/><br/>\\n\\nFor you, I\'ll break my own heart if I have to.\\nIt\'ll still be worth it.\\n\\n<footer>\u2014 **Randell Tuazon** <div class=\\"text-sm mt-1\\">*Notes While Daydreaming*</div></footer>"},{"id":"whats-not-to-love-partial","metadata":{"permalink":"/blogs/quotes/whats-not-to-love-partial","source":"@site/blogs/quotes/2023-11-29-whats-not-to-love-partial.md","title":"","description":"As far as I know, you\'re so much lovable,","date":"2023-11-29T00:00:00.000Z","formattedDate":"November 29, 2023","tags":[{"label":"quotes","permalink":"/blogs/quotes/tags/quotes"}],"readingTime":0.315,"hasTruncateMarker":false,"authors":[{"name":"Randell Tuazon","title":"Dev/Poet/Writer","url":"https://www.instagram.com/randelltuazon.poetry","imageURL":"https://2.gravatar.com/avatar/8d15e5eb3cd8eb14ada9c614f65cb4c53693993a98a784a05f0b2ba31e6bee46?size=128","key":"randelltuazon"}],"frontMatter":{"slug":"whats-not-to-love-partial","title":"","authors":["randelltuazon"],"keywords":["randell tuazon","quotes"],"tags":["quotes"]},"unlisted":false,"prevItem":{"title":"","permalink":"/blogs/quotes/break-my-own-heart"},"nextItem":{"title":"","permalink":"/blogs/quotes/my-favourites"}},"content":"<br/><br/>\\n\\nAs far as I know, you\'re so much lovable,  \\nFar beyond my league and insurmountable.  \\nBut I do not love you because of reason  \\nNor what attends presently at my vision,  \\nFor my heart does not think, nor does mind to see.  \\nI\'ll love you still, be certain or mystery.  \\n\\n<footer>\u2014 **Randell Tuazon** <div class=\\"text-sm mt-1\\">*100 Love Sonnets: What\'s Not to Love?*</div></footer>"},{"id":"my-favourites","metadata":{"permalink":"/blogs/quotes/my-favourites","source":"@site/blogs/quotes/2023-11-28-my-favourites.md","title":"","description":"It\'s your infinitely sweet sunshine smile,","date":"2023-11-28T00:00:00.000Z","formattedDate":"November 28, 2023","tags":[{"label":"quotes","permalink":"/blogs/quotes/tags/quotes"}],"readingTime":0.165,"hasTruncateMarker":false,"authors":[{"name":"Randell Tuazon","title":"Dev/Poet/Writer","url":"https://www.instagram.com/randelltuazon.poetry","imageURL":"https://2.gravatar.com/avatar/8d15e5eb3cd8eb14ada9c614f65cb4c53693993a98a784a05f0b2ba31e6bee46?size=128","key":"randelltuazon"}],"frontMatter":{"slug":"my-favourites","title":"","authors":["randelltuazon"],"keywords":["randell tuazon","quotes"],"tags":["quotes"]},"unlisted":false,"prevItem":{"title":"","permalink":"/blogs/quotes/whats-not-to-love-partial"},"nextItem":{"title":"","permalink":"/blogs/quotes/left-unanswered"}},"content":"<br/><br/>\\n\\nIt\'s your infinitely sweet sunshine smile,  \\nYour happy rounded eyes, and your wits.  \\nAll of them is in a long list of my favourites.  \\n\\n<footer>\u2014 **Randell Tuazon** <div class=\\"text-sm mt-2\\">*Notes While Daydreaming*</div></footer>"},{"id":"left-unanswered","metadata":{"permalink":"/blogs/quotes/left-unanswered","source":"@site/blogs/quotes/2023-11-28.md","title":"","description":"Somehow and often, there are no perfect answers to the questions of life.","date":"2023-11-28T00:00:00.000Z","formattedDate":"November 28, 2023","tags":[{"label":"quotes","permalink":"/blogs/quotes/tags/quotes"}],"readingTime":0.48,"hasTruncateMarker":false,"authors":[{"name":"Randell Tuazon","title":"Dev/Poet/Writer","url":"https://www.instagram.com/randelltuazon.poetry","imageURL":"https://2.gravatar.com/avatar/8d15e5eb3cd8eb14ada9c614f65cb4c53693993a98a784a05f0b2ba31e6bee46?size=128","key":"randelltuazon"}],"frontMatter":{"slug":"left-unanswered","title":"","authors":["randelltuazon"],"keywords":["randell tuazon","quotes"],"tags":["quotes"]},"unlisted":false,"prevItem":{"title":"","permalink":"/blogs/quotes/my-favourites"},"nextItem":{"title":"","permalink":"/blogs/quotes/fall-into-place"}},"content":"<br/><br/>\\n\\nSomehow and often, there are no perfect answers to the questions of life.\\nThe decision what to believe in what is right or real is always ours.\\nSometimes, to resolve something, *we just have to leave it right there at the corner, unanswered.*\\nSooner or later at their own right time, all the answers will reveal themselves.\\nOr maybe, we would then find out it was never really answered, because we didn\'t need to.\\n*We realize that we don\'t need the answer anymore.*\\n\\n<footer>\u2014 **Randell Tuazon** <div class=\\"text-sm mt-2\\">*Unsent Love Letters: A Touch of Reality*</div></footer>"},{"id":"fall-into-place","metadata":{"permalink":"/blogs/quotes/fall-into-place","source":"@site/blogs/quotes/2023-11-27-fall-into-place.md","title":"","description":"Focus on things within your control.","date":"2023-11-27T00:00:00.000Z","formattedDate":"November 27, 2023","tags":[{"label":"quotes","permalink":"/blogs/quotes/tags/quotes"}],"readingTime":0.175,"hasTruncateMarker":false,"authors":[{"name":"Randell Tuazon","title":"Dev/Poet/Writer","url":"https://www.instagram.com/randelltuazon.poetry","imageURL":"https://2.gravatar.com/avatar/8d15e5eb3cd8eb14ada9c614f65cb4c53693993a98a784a05f0b2ba31e6bee46?size=128","key":"randelltuazon"}],"frontMatter":{"slug":"fall-into-place","title":"","authors":["randelltuazon"],"keywords":["randell tuazon","quotes"],"tags":["quotes"]},"unlisted":false,"prevItem":{"title":"","permalink":"/blogs/quotes/left-unanswered"},"nextItem":{"title":"","permalink":"/blogs/quotes/stop-dreaming"}},"content":"<br/><br/>\\n\\nFocus on things within your control.  \\nDo the things you\'ve always been meaning to do.  \\nTake that first step,  \\nAnd everything else will fall into place.\\n\\n<footer>\u2014 **Randell Tuazon** <div class=\\"text-sm mt-2\\">*Notes While Daydreaming*</div></footer>"},{"id":"stop-dreaming","metadata":{"permalink":"/blogs/quotes/stop-dreaming","source":"@site/blogs/quotes/2023-11-27-stop-dreaming.md","title":"","description":"Stop dreaming,","date":"2023-11-27T00:00:00.000Z","formattedDate":"November 27, 2023","tags":[{"label":"quotes","permalink":"/blogs/quotes/tags/quotes"}],"readingTime":0.085,"hasTruncateMarker":false,"authors":[{"name":"Randell Tuazon","title":"Dev/Poet/Writer","url":"https://www.instagram.com/randelltuazon.poetry","imageURL":"https://2.gravatar.com/avatar/8d15e5eb3cd8eb14ada9c614f65cb4c53693993a98a784a05f0b2ba31e6bee46?size=128","key":"randelltuazon"}],"frontMatter":{"slug":"stop-dreaming","title":"","authors":["randelltuazon"],"keywords":["randell tuazon","quotes"],"tags":["quotes"]},"unlisted":false,"prevItem":{"title":"","permalink":"/blogs/quotes/fall-into-place"},"nextItem":{"title":"","permalink":"/blogs/quotes/you-can-never-be-perfect"}},"content":"<br/><br/>\\n\\nStop dreaming,  \\nand start becoming someone else\'s dream. \\n\\n<footer>\u2014 **Randell Tuazon** <div class=\\"text-sm mt-2\\">*Notes While Daydreaming*</div></footer>"},{"id":"you-can-never-be-perfect","metadata":{"permalink":"/blogs/quotes/you-can-never-be-perfect","source":"@site/blogs/quotes/2023-11-26-you-can-never-be-perfect.md","title":"","description":"You can never be perfect, but chase it anyway.","date":"2023-11-26T00:00:00.000Z","formattedDate":"November 26, 2023","tags":[{"label":"quotes","permalink":"/blogs/quotes/tags/quotes"}],"readingTime":0.135,"hasTruncateMarker":false,"authors":[{"name":"Randell Tuazon","title":"Dev/Poet/Writer","url":"https://www.instagram.com/randelltuazon.poetry","imageURL":"https://2.gravatar.com/avatar/8d15e5eb3cd8eb14ada9c614f65cb4c53693993a98a784a05f0b2ba31e6bee46?size=128","key":"randelltuazon"}],"frontMatter":{"slug":"you-can-never-be-perfect","title":"","authors":["randelltuazon"],"keywords":["randell tuazon","quotes"],"tags":["quotes"]},"unlisted":false,"prevItem":{"title":"","permalink":"/blogs/quotes/stop-dreaming"},"nextItem":{"title":"","permalink":"/blogs/quotes/full-of-cowards"}},"content":"<br/><br/>\\n\\nYou can never be perfect, but chase it anyway.  \\nYou can always be a better version of yourself.  \\n\\n<footer>\u2014 **Randell Tuazon** <div class=\\"text-sm mt-2\\">*Notes While Daydreaming*</div></footer>"},{"id":"full-of-cowards","metadata":{"permalink":"/blogs/quotes/full-of-cowards","source":"@site/blogs/quotes/2023-11-25-full-of-cowards.md","title":"","description":"The world is full of cowards out there.","date":"2023-11-25T00:00:00.000Z","formattedDate":"November 25, 2023","tags":[{"label":"quotes","permalink":"/blogs/quotes/tags/quotes"}],"readingTime":0.15,"hasTruncateMarker":false,"authors":[{"name":"Randell Tuazon","title":"Dev/Poet/Writer","url":"https://www.instagram.com/randelltuazon.poetry","imageURL":"https://2.gravatar.com/avatar/8d15e5eb3cd8eb14ada9c614f65cb4c53693993a98a784a05f0b2ba31e6bee46?size=128","key":"randelltuazon"}],"frontMatter":{"slug":"full-of-cowards","title":"","authors":["randelltuazon"],"keywords":["randell tuazon","quotes"],"tags":["quotes"]},"unlisted":false,"prevItem":{"title":"","permalink":"/blogs/quotes/you-can-never-be-perfect"},"nextItem":{"title":"","permalink":"/blogs/quotes/other-half"}},"content":"<br/><br/>\\n\\nThe world is full of cowards out there.  \\nI just wanted to make sure  \\nyou won\'t run into one of those.  \\n\\n<footer>\u2014 **Randell Tuazon** <div class=\\"text-sm mt-2\\">*Notes While Daydreaming*</div></footer>"},{"id":"other-half","metadata":{"permalink":"/blogs/quotes/other-half","source":"@site/blogs/quotes/2023-11-24-other-half.md","title":"","description":"You maybe my other half.","date":"2023-11-24T00:00:00.000Z","formattedDate":"November 24, 2023","tags":[{"label":"quotes","permalink":"/blogs/quotes/tags/quotes"}],"readingTime":0.09,"hasTruncateMarker":false,"authors":[{"name":"Randell Tuazon","title":"Dev/Poet/Writer","url":"https://www.instagram.com/randelltuazon.poetry","imageURL":"https://2.gravatar.com/avatar/8d15e5eb3cd8eb14ada9c614f65cb4c53693993a98a784a05f0b2ba31e6bee46?size=128","key":"randelltuazon"}],"frontMatter":{"slug":"other-half","title":"","authors":["randelltuazon"],"keywords":["randell tuazon","quotes"],"tags":["quotes"]},"unlisted":false,"prevItem":{"title":"","permalink":"/blogs/quotes/full-of-cowards"},"nextItem":{"title":"","permalink":"/blogs/quotes/love-you-quietly-and-alone"}},"content":"<br/><br/>\\n\\nYou maybe my other half.  \\nOr perhaps, my whole.\\n\\n<footer>\u2014 **Randell Tuazon** <div class=\\"text-sm mt-2\\">*Notes While Daydreaming*</div></footer>"},{"id":"love-you-quietly-and-alone","metadata":{"permalink":"/blogs/quotes/love-you-quietly-and-alone","source":"@site/blogs/quotes/2023-11-23-love-you-quietly-and-alone.md","title":"","description":"I do not need you to know me.","date":"2023-11-23T00:00:00.000Z","formattedDate":"November 23, 2023","tags":[{"label":"quotes","permalink":"/blogs/quotes/tags/quotes"}],"readingTime":0.13,"hasTruncateMarker":false,"authors":[{"name":"Randell Tuazon","title":"Dev/Poet/Writer","url":"https://www.instagram.com/randelltuazon.poetry","imageURL":"https://2.gravatar.com/avatar/8d15e5eb3cd8eb14ada9c614f65cb4c53693993a98a784a05f0b2ba31e6bee46?size=128","key":"randelltuazon"}],"frontMatter":{"slug":"love-you-quietly-and-alone","title":"","authors":["randelltuazon"],"keywords":["randell tuazon","quotes"],"tags":["quotes"]},"unlisted":false,"prevItem":{"title":"","permalink":"/blogs/quotes/other-half"},"nextItem":{"title":"","permalink":"/blogs/quotes/soul-searching"}},"content":"<br/><br/>\\n\\nI do not need you to know me.  \\nI just want to love you quietly and alone.  \\n\\n<footer>\u2014 **Randell Tuazon** <div class=\\"text-sm mt-2\\">*Notes While Daydreaming*</div></footer>"},{"id":"soul-searching","metadata":{"permalink":"/blogs/quotes/soul-searching","source":"@site/blogs/quotes/2023-11-09-soul-searching.md","title":"","description":"I have grown weary from only watching and waiting.","date":"2023-11-09T00:00:00.000Z","formattedDate":"November 9, 2023","tags":[{"label":"quotes","permalink":"/blogs/quotes/tags/quotes"}],"readingTime":0.17,"hasTruncateMarker":false,"authors":[{"name":"Randell Tuazon","title":"Dev/Poet/Writer","url":"https://www.instagram.com/randelltuazon.poetry","imageURL":"https://2.gravatar.com/avatar/8d15e5eb3cd8eb14ada9c614f65cb4c53693993a98a784a05f0b2ba31e6bee46?size=128","key":"randelltuazon"}],"frontMatter":{"slug":"soul-searching","title":"","authors":["randelltuazon"],"keywords":["randell tuazon","quotes"],"tags":["quotes"]},"unlisted":false,"prevItem":{"title":"","permalink":"/blogs/quotes/love-you-quietly-and-alone"},"nextItem":{"title":"","permalink":"/blogs/quotes/marry-you-anywhere"}},"content":"<br/><br/>\\n\\nI have grown weary from only watching and waiting.  \\nNow marks the time perfectly for some soul-searching.  \\nAnd maybe... just maybe, I\'ll find you too.  \\n\\n<footer>\u2014 **Randell Tuazon** <div class=\\"text-sm mt-2\\">*Notes While Daydreaming*</div></footer>"},{"id":"marry-you-anywhere","metadata":{"permalink":"/blogs/quotes/marry-you-anywhere","source":"@site/blogs/quotes/2023-11-08-marry-you-anywhere.md","title":"","description":"I\'ll marry you anywhere an altar stands,","date":"2023-11-08T00:00:00.000Z","formattedDate":"November 8, 2023","tags":[{"label":"quotes","permalink":"/blogs/quotes/tags/quotes"}],"readingTime":0.32,"hasTruncateMarker":false,"authors":[{"name":"Randell Tuazon","title":"Dev/Poet/Writer","url":"https://www.instagram.com/randelltuazon.poetry","imageURL":"https://2.gravatar.com/avatar/8d15e5eb3cd8eb14ada9c614f65cb4c53693993a98a784a05f0b2ba31e6bee46?size=128","key":"randelltuazon"}],"frontMatter":{"slug":"marry-you-anywhere","title":"","authors":["randelltuazon"],"keywords":["randell tuazon","quotes"],"tags":["quotes"]},"unlisted":false,"prevItem":{"title":"","permalink":"/blogs/quotes/soul-searching"},"nextItem":{"title":"","permalink":"/blogs/quotes/deeply-in-the-soul"}},"content":"<br/><br/>\\n\\nI\'ll marry you anywhere an altar stands,  \\nand all our favourite beaches with white sands.  \\nWith vows of loving you, old and anew,  \\nMy eternal drops of morning dew.  \\nI\'ll marry you everyday on our quiet gardens,  \\nOn our short dates, and long trips.  \\nRemind you each day how much I love you.  \\nWill you?  \\n\\n<footer>\u2014 **Randell Tuazon** <div class=\\"text-sm mt-2\\">*Notes While Daydreaming*</div></footer>"},{"id":"deeply-in-the-soul","metadata":{"permalink":"/blogs/quotes/deeply-in-the-soul","source":"@site/blogs/quotes/2014-11-14-such-a-shame.md","title":"","description":"It\'s such a shame the world will never know...","date":"2014-11-14T00:00:00.000Z","formattedDate":"November 14, 2014","tags":[{"label":"quotes","permalink":"/blogs/quotes/tags/quotes"}],"readingTime":0.13,"hasTruncateMarker":false,"authors":[{"name":"Randell Tuazon","title":"Dev/Poet/Writer","url":"https://www.instagram.com/randelltuazon.poetry","imageURL":"https://2.gravatar.com/avatar/8d15e5eb3cd8eb14ada9c614f65cb4c53693993a98a784a05f0b2ba31e6bee46?size=128","key":"randelltuazon"}],"frontMatter":{"slug":"deeply-in-the-soul","title":"","authors":["randelltuazon"],"keywords":["randell tuazon","quotes"],"tags":["quotes"]},"unlisted":false,"prevItem":{"title":"","permalink":"/blogs/quotes/marry-you-anywhere"},"nextItem":{"title":"","permalink":"/blogs/quotes/lone-man-sober"}},"content":"<br/><br/>\\n\\nIt\'s such a shame the world will never know...  \\nHow I love you deeply in the soul.  \\n\\n<footer>\u2014 **Randell Tuazon** <div class=\\"text-sm mt-2\\">*Notes While Daydreaming*</div></footer>"},{"id":"lone-man-sober","metadata":{"permalink":"/blogs/quotes/lone-man-sober","source":"@site/blogs/quotes/2014-11-13-lone-man-sober.md","title":"","description":"In a house full of drunks, and cheats and loud sound,","date":"2014-11-13T00:00:00.000Z","formattedDate":"November 13, 2014","tags":[{"label":"quotes","permalink":"/blogs/quotes/tags/quotes"}],"readingTime":0.365,"hasTruncateMarker":false,"authors":[{"name":"Randell Tuazon","title":"Dev/Poet/Writer","url":"https://www.instagram.com/randelltuazon.poetry","imageURL":"https://2.gravatar.com/avatar/8d15e5eb3cd8eb14ada9c614f65cb4c53693993a98a784a05f0b2ba31e6bee46?size=128","key":"randelltuazon"}],"frontMatter":{"slug":"lone-man-sober","title":"","authors":["randelltuazon"],"keywords":["randell tuazon","quotes"],"tags":["quotes"]},"unlisted":false,"prevItem":{"title":"","permalink":"/blogs/quotes/deeply-in-the-soul"}},"content":"<br/><br/>\\n\\nIn a house full of drunks, and cheats and loud sound,  \\nHardly the place where love\'s likely to be found.  \\nI was the lone man sober, and yet more mad,  \\nGlued in one corner by myself, seeming odd.  \\n&nbsp;&nbsp; *While all men were looking for the easy one to fuck,*  \\n&nbsp;&nbsp; *There I was a fool, waiting and looking for love.*  \\n\\n<footer>\u2014 **Randell Tuazon** <div class=\\"text-sm mt-1\\">*100 Love Sonnets: Lone Man Sober*</div></footer>"}]}')}}]);